function addZero(i) {
    if (i < 10) {
        i = "0" + i;
    }
    return i;
}

function addObjectToCanvas(o, selected) {
    if (o.type === 'link') {
        var fromObject = null;
        var toObject = null;
        for (var i = 0; i < canvas.getObjects().length; i++) {
            if (canvas.item(i).id == o.obj_a) {
                fromObject = canvas.item(i);
            }
            if (canvas.item(i).id == o.obj_b) {
                toObject = canvas.item(i);
            }
        }
        var from = {x: 0, y: 0};
        var to = {x: 0, y: 0};
        var pending = true;
        if (fromObject !== null && toObject !== null) {
            var from = fromObject.getCenterPoint();
            var to = toObject.getCenterPoint();
            pending = false;
        }
        var line = new fabric.Line([from.x, from.y, to.x, to.y], {
            pending: pending,
            id: o.id,
            objType: 'link',
            image: o.image,
            name_val: o.name,
            from: o.obj_a,
            to: o.obj_b,
            fill: '#000000',
            stroke: o.stroke_color,
            strokeWidth: 3,
            hasControls: false,
            selctable: true,
            lockMovementX: true,
            lockMovementY: true,
            lockScalingX: true,
            lockScalingY: true,
            lockRotation: true,
        });
        var angle = (Math.atan2((line.y1 - line.y2), (line.x1 - line.x2))) * (180/Math.PI);
            if(Math.abs(angle) > 90)
                angle += 180;
        var name = new fabric.Text(o.name, {
            parent_id: o.id,
            parent: line,
            objType: 'name',
            selectable: false,
            originX: 'center',
            originY: 'top',
            textAlign: 'center',
            fill: '#000000',
            angle: angle,
            fontSize: 12,
            fontFamily: 'verdana',
            left: line.getCenterPoint().x,
            top: line.getCenterPoint().y
        });
        line.children = [name];
        canvas.add(line);
        canvas.add(name);
        line.moveTo(o.z*2);
        name.moveTo(o.z*2+1);
    } else if (o.type === 'icon' && o.image !== undefined && o.image !== null) {
        getIcon(o.image, function() {
            SVGCache[o.image].clone(function(shape) {
                var name;
                shape.set({
                    fill: o.fill_color,
                    stroke: o.stroke_color,
                    strokeWidth: 1,
                    scaleX: o.scale_x,
                    scaleY: o.scale_y,
                    angle: o.rot,
                    id: o.id,
                    objType: o.type,
                    image: o.image,
                    name_val: o.name,
                    originX: 'center',
                    originY: 'center',
                    left: o.x,
                    top: o.y,
                    lockMovementX: !diagram_rw,
                    lockMovementY: !diagram_rw,
                    lockScalingX: !diagram_rw,
                    lockScalingY: !diagram_rw,
                    lockRotation: !diagram_rw
                });
                if (shape.paths && !shape.image.includes('static')) {
                    for (var i = 0; i < shape.paths.length; i++) {
                        if (shape.paths[i].fill !== 'rgba(254,254,254,1)' && shape.paths[i].fill !== '') {
                            shape.paths[i].setFill(o.fill_color);
                        }
                        if (shape.paths[i].stroke !== 'rgba(254,254,254,1)') {
                            shape.paths[i].setStroke(o.stroke_color);
                        }
                    }
                }
                name = new fabric.Text(o.name, {
                    parent_id: o.id,
                    parent: shape,
                    objType: 'name',
                    selectable: false,
                    originX: 'center',
                    originY: 'top',
                    textAlign: 'center',
                    fill: '#000000',
                    fontSize: 12,
                    fontFamily: 'lato',
                    left: o.x,
                    top: o.y + (shape.getHeight()/2)
                });
                shape.children = [name];
                objectsLoaded.pop();
                canvas.add(shape);
                canvas.add(name);
                if (selected === 'single')
                    canvas.setActiveObject(shape);
                else if (selected === 'group')
                    canvas.getActiveGroup().addWithUpdate(shape);
                shape.moveTo(o.z*2);
                name.moveTo(o.z*2+1);
            });
        });
    } else if (o.type === 'shape') {
        var shape = o.image.split('-')[3].split('.')[0];
        if (shape === 'rect') {
            shape = new fabric.Rect({
                width: o.scale_x,
                height: o.scale_y,
                angle: o.rot,
                fill: o.fill_color,
                stroke: o.stroke_color,
                strokeWidth: 2,
                id: o.id,
                objType: o.type,
                image: o.image,
                name_val: o.name,
                name: name,
                originX: 'center',
                originY: 'center',
                left: o.x,
                top: o.y,
                lockMovementX: !diagram_rw,
                lockMovementY: !diagram_rw,
                lockScalingX: !diagram_rw,
                lockScalingY: !diagram_rw,
                lockRotation: !diagram_rw
            });
        } else if (shape === 'circle') {
            shape = new fabric.Ellipse({
                rx: o.scale_x / 2,
                ry: o.scale_y / 2,
                angle: o.rot, 
                fill: o.fill_color,
                stroke: o.stroke_color,
                strokeWidth: 2,
                id: o.id,
                objType: o.type,
                image: o.image,
                name_val: o.name,
                name: name,
                originX: 'center',
                originY: 'center',
                left: o.x,
                top: o.y,
                lockMovementX: !diagram_rw,
                lockMovementY: !diagram_rw,
                lockScalingX: !diagram_rw,
                lockScalingY: !diagram_rw,
                lockRotation: !diagram_rw
            });
        } else
            return;
        name = new fabric.Text(o.name, {
            parent_id: o.id,
            parent: shape,
            objType: 'name',
            selectable: false,
            originX: 'center',
            originY: 'top',
            textAlign: 'center',
            fill: '#000000',
            fontSize: 12,
            fontFamily: 'verdana',
            left: o.x,
            top: o.y + (shape.getHeight()/2)
        });
        shape.children = [name];
        canvas.add(shape);
        canvas.add(name);
        if (selected === 'single')
            canvas.setActiveObject(shape);
        else if (selected === 'group')
            canvas.getActiveGroup().addWithUpdate(shape);
        shape.moveTo(o.z*2);
        name.moveTo(o.z*2+1);
    }
}

